import React, { useState, useEffect } from 'react';
import jsPDF from 'jspdf';
import 'jspdf-autotable';
import './App.css';

const FilterNews = () => {
  const [crimeEntries, setCrimeEntries] = useState([]);
  const [filteredEntries, setFilteredEntries] = useState([]);
  const [search, setSearch] = useState({ category: '', tags: '', date: '', location: '' });

  useEffect(() => {
    fetch('http://localhost:5000/entries')
      .then((response) => response.json())
      .then((data) => setCrimeEntries(data))
      .catch((error) => console.error('Error fetching entries:', error));
  }, []);

  const applyFilters = () => {
    const filtered = crimeEntries.filter(entry =>
      (search.category === '' || entry.category === search.category) &&
      (search.tags === '' || entry.tags.includes(search.tags)) &&
      (search.date === '' || entry.date === search.date) &&
      (search.location === '' || entry.location.toLowerCase().includes(search.location.toLowerCase()))
    );
    setFilteredEntries(filtered);
  };

  const exportToPDF = () => {
    const doc = new jsPDF();
    doc.text('Filtered Crime Entries', 14, 10);
    doc.autoTable({
      head: [['Title', 'Description', 'Date', 'Category', 'Tags', 'Location']],
      body: filteredEntries.map(entry => [entry.title, entry.description, entry.date, entry.category, entry.tags, entry.location]),
      startY: 20,
    });
    doc.save('Filtered_CrimeEntries.pdf');
  };

  const handleSearchChange = (e) => {
    const { name, value } = e.target;
    setSearch({ ...search, [name]: value });
  };

  return (
    <div className="content-container">
      <div className="card">
        <h2>Filter News</h2>
        {/* Filter Form */}
        <div className="form-container">
          {/* Filter fields */}
          <label>Category:</label>
          <select name="category" value={search.category} onChange={handleSearchChange}>
            <option value="">All Categories</option>
            <option value="violent-crimes">Violent Crimes</option>
            <option value="property-crimes">Property Crimes</option>
            {/* Add other options */}
          </select>
          {/* Add other filter fields */}
          <button onClick={applyFilters} className="filter-button">Apply Filter</button>
        </div>
      </div>
      <div className="card">
        <h2>Filtered Crime Entries</h2>
        <table className="crime-table">
          <thead>
            <tr>
              <th>Title</th>
              <th>Description</th>
              <th>Date</th>
              <th>Category</th>
              <th>Tags</th>
              <th>Location</th>
            </tr>
          </thead>
          <tbody>
            {filteredEntries.map((entry) => (
              <tr key={entry.id}>
                <td>{entry.title}</td>
                <td>{entry.description}</td>
                <td>{entry.date}</td>
                <td>{entry.category}</td>
                <td>{entry.tags}</td>
                <td>{entry.location}</td>
              </tr>
            ))}
          </tbody>
        </table>
        <button onClick={exportToPDF} className="export-button">Export to PDF</button>
      </div>
    </div>
  );
};

export default FilterNews;
